import React from "react";
import {
    BarChart,
    Bar,
    Cell,
    XAxis,
    YAxis,
    CartesianGrid,
    Tooltip,
    Legend,
    ResponsiveContainer,
} from "recharts";

function Home() {
    const data = [
        {
            name: "Page A",
            uv: 4000,
            pv: 2400,
            amt: 2400,
        },
        {
            name: "Page B",
            uv: 3000,
            pv: 1398,
            amt: 2210,
        },
        {
            name: "Page C",
            uv: 2000,
            pv: 9800,
            amt: 2290,
        },
        {
            name: "Page D",
            uv: 2780,
            pv: 3908,
            amt: 2000,
        },
        {
            name: "Page E",
            uv: 1890,
            pv: 4800,
            amt: 2181,
        },
        {
            name: "Page F",
            uv: 2390,
            pv: 3800,
            amt: 2500,
        },
        {
            name: "Page G",
            uv: 3490,
            pv: 4300,
            amt: 2100,
        },
    ];

    return (
        <div>
            <h2>항행통신부 종합통신소 장애 관리</h2>
            <>
                <div>
                    <ResponsiveContainer width="100%" height="100%">
                        <BarChart
                            width={690}
                            height={350}
                            data={data}
                            margin={{ top: 30, right: 0, bottom: 20, left: 0 }}
                        >
                            <CartesianGrid strokeDasharray="3 3" />
                            <XAxis dataKey="name" />
                            <YAxis />
                            <Tooltip />
                            <Legend
                                wrapperStyle={{
                                    backgroundColor: "#f5f5f5",
                                }}
                            />

                            <Bar dataKey="count" barSize={30} fill="#7ac4c0" />
                        </BarChart>
                    </ResponsiveContainer>
                </div>
            </>
        </div>
    );
}

export default Home;
